import React from 'react';

import ProjectHeader from '../../components/01_sections/header/ProjectHeader';

function Weddell() {
  function resizeIframe(obj) {
    obj.style.height =
      obj.contentWindow.document.documentElement.scrollHeight + 'px';
  }
  return (
    <div height="500px">
      <ProjectHeader />
      <iframe
        src="https://noahsjung.com/works/weddell"
        // style="border: 0"
        position="fixed"
        width="100%"
        frameBorder="0"
        height="100vh"
        scrolling="no"
        onload={resizeIframe(this)}
        title="weddell"
      ></iframe>
    </div>
  );
}

export default Weddell;
